import styled from 'styled-components';

export const Container = styled.div`
   display: flex;
  align-items: center;
  justify-content: center;

`;

export const Image = styled.img`
    width: 200px;
    height: 77px;
    display: flex;
    justify-content: center;
    float: left;
    margin-top: 20px;


`;
